import React, { Component } from "react";
import { addRessource } from "../../actions/index";
import { connect } from "react-redux";

class Ressources extends Component {
  addRessource() {
    this.props.addRessource();
  }

  render() {
    return (
      <div>
        <div className="row">
          <div className="col">
            <button
              type="button"
              onClick={() => this.props.addRessource()}
              className="btn btn-raised btn-primary"
            >
              Ajouter un nombre
            </button>
          </div>
        </div>
        <div className="row">
          <div className="col"> Entiers </div>
          <div className="col"> Contiennent 1 </div>
          <div className="col"> Entier premiers </div>
          <div className="col"> Entier premiers contenant 1 </div>
        </div>
      </div>
    );
  }
}

const mapStateToProps = state => {
  return {
    addRessource: state.ressources.ressourcesList
  };
};

const mapDispatchToProps = {};

export default connect(
  mapStateToProps,
  mapDispatchToProps
)(Ressources);
